import React from 'react';

export const DropDownMenu = ({ isMenuClick, setMenuClick }) => {
  return (
    <nav className='drop-down-menu-nav'>
      <a
        href='#about'
        onClick={() => {
          setMenuClick(!isMenuClick);
        }}
      >
        About
      </a>
      <a
        href='#projects'
        onClick={() => {
          setMenuClick(!isMenuClick);
        }}
      >
        Projects
      </a>
      <a
        href='#contact'
        onClick={() => {
          setMenuClick(!isMenuClick);
        }}
      >
        Contact
      </a>
    </nav>
  );
};

